description:
Women, The (2008)  

Verenigde Staten
Komedie / Drama
114 minuten

geregisseerd door Diane English
met Meg Ryan, Eva Mendes en Annette Bening

Mary Haines (Ryan) is een vrouw die geliefd is bij, en gerespecteerd wordt door, haar vrienden. De grote vriendenkring komt in gevaar als Mary's echtgenote vreemd blijkt te gaan en sommige vrienden wellicht niet noemenswaardig als vriend zijn.

